import React, { useEffect, useState } from "react";
import axios from "axios";
import Loader from "../../components/Loader"; // Optional: use your Loader component

const MyLectures = () => {
  const [lectures, setLectures] = useState([]);
  const [loading, setLoading] = useState(true);
  const [message, setMessage] = useState("");

  useEffect(() => {
    const fetchLectures = async () => {
      const token = localStorage.getItem("instructorToken");
      if (!token) {
        setMessage("Please login first");
        setLoading(false);
        return;
      }

      try {
        const res = await axios.get(
          "http://localhost:5000/api/instructor/my-lectures",
          {
            headers: { Authorization: `Bearer ${token}` },
          }
        );
        setLectures(res.data);
      } catch (err) {
        setMessage(err.response?.data?.message || "Error fetching lectures");
      } finally {
        setLoading(false);
      }
    };

    fetchLectures();
  }, []);

  return (
    <div className="container mx-auto mt-10 max-w-3xl">
      <h2 className="text-3xl font-bold mb-6 border-b-4 border-blue-600 inline-block pb-2">
        My Lectures
      </h2>

      {loading && <Loader />}

      {message && !loading && <p className="text-red-600 mb-4">{message}</p>}

      {!loading && lectures.length === 0 && !message && (
        <p className="text-gray-600">No lectures assigned yet.</p>
      )}

      {!loading && lectures.length > 0 && (
        <div className="overflow-x-auto shadow-lg rounded-lg border border-gray-200">
          <table className="min-w-full bg-white divide-y divide-gray-200">
            <thead className="bg-blue-600 text-white">
              <tr>
                <th className="px-6 py-3 text-left text-sm font-semibold uppercase tracking-wider">
                  Course Name
                </th>
                <th className="px-6 py-3 text-left text-sm font-semibold uppercase tracking-wider">
                  Lecture Date
                </th>
              </tr>
            </thead>
            <tbody className="divide-y divide-gray-200">
              {lectures.map((lec, index) => (
                <tr
                  key={index}
                  className={index % 2 === 0 ? "bg-gray-50" : "bg-white"}
                >
                  <td className="px-6 py-4 whitespace-nowrap text-gray-800 font-medium">
                    {lec.courseName}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-gray-700">
                    {new Date(lec.date).toLocaleDateString()}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default MyLectures;
